@LuisLuloal Creo que las cosas que ha hecho son muy graves. 
Por ello hay procedimiento penal en el que puede aparecer su nombre... 
Hacer trabajo para dar a conocer Vox, vale. Pero hay limites.

@curandero_el Pues Tamames ha impuesto sus condiciones y Abascal ha agachado cabeza en cuestiones muy controvertidas. 
Se supone que Tamames iba a ser un instrumento, y Vox ha terminado siendolo para el. 😒 
Me lo dicen hace un ano y no lo hubiese creido.

@Jea60930295 Verdaderas barbaridades se hicieron durante la segunda Republica. Hasta que hubo el levantamiento, que no fue otra cosa que una reaccion a tanta delincuencia, latrocinio, anarquismo y vandalismo. 
Hubo 8 golpes de estado contra la II Republica.
¡8 anos para olvidar!

@RafaMor49 Yo me hubiera levantado y colocado la bandera en su sitio. 
Y si me rechista, le diria: « a mi tampoco me gusta su cara y aqui estamos »
¿Nadie tiene coraje para ponerse en su lugar?

